import React from "react";
import "../css/screem.css";

function screem() {
    return (
        <div className="contenedor-screem">
            <div className="row-video">
                <div className="video">
                    <iframe width="560" height="315" src="https://www.youtube.com/embed/7YIKz6KgKkE" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                </div>
            </div>
        </div>
    
   );
}

export default screem
